export async function main(ns) {
    maxValueServers = {
        zero: [],
        million: [],
        billion: [],
        trillion: []
    };
    findServer(ns, 'home', 'home', checkValue);
    ns.run(`/${getFolder()}/remoteHack.js`, 1, highest(ns).join(','));
